// src/components/Transportation.js
import React, { useState, useEffect } from 'react';
import { motion, AnimatePresence } from 'framer-motion';

const Transportation = () => {
  const [fromLocation, setFromLocation] = useState('');
  const [transportData, setTransportData] = useState(null);
  const [activeTab, setActiveTab] = useState('trains');

  const popularLocations = ['Delhi', 'Bangalore', 'Chennai', 'Kolkata', 'Hyderabad'];

  const mockTransportData = {
    trains: [
      { name: 'Rajdhani Express', time: '08:00 AM', duration: '16h', type: 'Superfast' },
      { name: 'Duronto Express', time: '09:30 PM', duration: '15h', type: 'Superfast' },
      { name: 'Shatabdi Express', time: '06:15 AM', duration: '17h', type: 'Superfast' }
    ],
    buses: [
      { name: 'Volvo AC Sleeper', time: '08:00 PM', duration: '12h', type: 'Luxury' },
      { name: 'Mercedes Multi-axle', time: '10:00 PM', duration: '11h', type: 'Semi-Luxury' },
      { name: 'AC Seater', time: '11:00 PM', duration: '13h', type: 'Deluxe' }
    ]
  };

  useEffect(() => {
    if (fromLocation) {
      setTimeout(() => {
        setTransportData(mockTransportData);
      }, 1000);
    }
  }, [fromLocation]);

  const cardVariants = {
    hidden: { y: 50, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1,
      transition: { duration: 0.6 }
    }
  };

  return (
    <section className="section-padding bg-cream">
      <motion.div
        initial="hidden"
        whileInView="visible"
        viewport={{ once: true }}
        variants={cardVariants}
        className="max-w-6xl mx-auto"
      >
        <h2 className="luxury-heading text-center mb-12">
          Transportation Guide
        </h2>

        <div className="gold-accent bg-white p-10 rounded-2xl">
          <div className="mb-8">
            <label className="luxury-text text-xl block mb-4 text-center">
              Select your starting location:
            </label>
            <select
              value={fromLocation}
              onChange={(e) => setFromLocation(e.target.value)}
              className="w-full max-w-xs mx-auto p-4 text-xl border-2 border-gold rounded-lg font-cormorant block"
            >
              <option value="">Choose a location</option>
              {popularLocations.map(location => (
                <option key={location} value={location}>{location}</option>
              ))}
            </select>
          </div>

          <AnimatePresence>
            {fromLocation && transportData && (
              <motion.div
                initial={{ opacity: 0, height: 0 }}
                animate={{ opacity: 1, height: 'auto' }}
                exit={{ opacity: 0, height: 0 }}
              >
                <div className="flex gap-6 mb-8 justify-center flex-wrap">
                  <button
                    onClick={() => setActiveTab('trains')}
                    className={`luxury-btn ${activeTab === 'trains' ? 'bg-burgundy text-white' : ''}`}
                  >
                    Trains
                  </button>
                  <button
                    onClick={() => setActiveTab('buses')}
                    className={`luxury-btn ${activeTab === 'buses' ? 'bg-burgundy text-white' : ''}`}
                  >
                    Buses
                  </button>
                </div>

                <div className="space-y-4">
                  {transportData[activeTab]?.map((item, index) => (
                    <motion.div
                      key={index}
                      initial={{ opacity: 0, x: -50 }}
                      animate={{ opacity: 1, x: 0 }}
                      transition={{ delay: index * 0.1 }}
                      className="gold-accent p-6 rounded-xl bg-light-gold"
                    >
                      <div className="flex justify-between items-center flex-col md:flex-row gap-4">
                        <div className="text-center md:text-left">
                          <h4 className="luxury-heading text-2xl mb-2">{item.name}</h4>
                          <p className="luxury-text">Type: {item.type}</p>
                        </div>
                        <div className="text-center md:text-right">
                          <p className="luxury-text">
                            ‚è∞ {item.time} | üïí {item.duration}
                          </p>
                        </div>
                      </div>
                    </motion.div>
                  ))}
                </div>
              </motion.div>
            )}
          </AnimatePresence>
        </div>
      </motion.div>
    </section>
  );
};

export default Transportation;
